export const SIGN_OUT = "SIGN_OUT";
export const AUTHENTICATE_USER = "AUTHENTICATE_USER";

export const signOut = (id) => {
    return {
        type: SIGN_OUT,
        id
    };
}

export const authenticateUser = (username) => {
    return {
        type: AUTHENTICATE_USER,
        username
    };
}
